    i0.\u0275\u0275domElementStart(288, "div", 111);
    i0.\u0275\u0275text(289, " [1] Never before have I chafed so much at being so busy that I could not accompany you when you set out for Campania to recover your health, nor yet follow and overtake you after you had started. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(290, "div", 111);
    i0.\u0275\u0275text(291, " [2] For now especially I should like to be with you to see with my own eyes how much strength you are gaining, what weight that delicate frame of yours is putting on, and whether you are enjoying yourself without let or hindrance in the relaxation and among the rich, generous pleasures of Campania. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(292, "div", 111);
    i0.\u0275\u0275text(293, " [3] I am quite anxiously longing to hear that you are strong again, for it makes one nervous and troubled to get no news of those whom we love very dearly, when they are away from us, and your absence, coupled with your weak state of health, keeps me constantly upon the rack. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(294, "div", 111);
    i0.\u0275\u0275text(295, " [4] I am afraid of all sorts of things; I fancy anything may have happened, and, like all anxious people, I am especially given to conjuring up the thoughts that I most dread. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(296, "div", 111);
    i0.\u0275\u0275text(297, " [5] I entreat you, therefore, to remember how nervous I am about you, and write me once, or even twice a day. For while I am reading your letters, I shall feel easier in my mind, though, when I have read through to the end, my fears will immediately recur. Farewell. ");
    i0.\u0275\u0275domElementEnd()()();
