    i0.\u0275\u0275domElementStart(1600, "span", 747);
    i0.\u0275\u0275text(1601, "omnibus ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1602, "span", 324);
    i0.\u0275\u0275text(1603, "scribere");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(1604, ". ");
    i0.\u0275\u0275domElementStart(1605, "span", 748);
    i0.\u0275\u0275text(1606, "Vale");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(1607, ". ");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1608, "div", 212)(1609, "h2");
    i0.\u0275\u0275text(1610, "English Translation");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1611, "div", 111);
    i0.\u0275\u0275text(1612, " [1] You ask me to send you an account of my uncle's death, so that you may be able to give posterity an accurate description of it. I am much obliged to you, for I can see that the immortality of his fame is well assured, if you take in hand to write of it. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1613, "div", 111);
    i0.\u0275\u0275text(1614, " [2] For although he perished in a disaster which devastated some of the fairest regions of the land, and though he is sure of eternal remembrance like the peoples and cities that fell with him in that memorable calamity, though too he had written a large number of works of lasting value, yet the undying fame of which your writings are assured will secure for his a still further lease of life. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1615, "div", 111);
    i0.\u0275\u0275text(1616, " [3] For my own part, I think that those people are highly favoured by Providence who are capable either of performing deeds worthy of the historian's pen or of writing histories worthy of being read, but that they are peculiarly favoured who can do both. Among the latter I may class my uncle, thanks to his own writings and to yours. So I am all the more ready to fulfil your injunctions, nay, I am even prepared to beg to be allowed to undertake them. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1617, "div", 111);
    i0.\u0275\u0275text(1618, " [4] My uncle was stationed at Misenum, where he was in active command of the fleet, with full powers. On the 24th of August, about the seventh hour, my mother drew his attention to the fact that a cloud of unusual size and shape had made its appearance. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1619, "div", 111);
    i0.\u0275\u0275text(1620, " [5] He had been out in the sun, followed by a cold bath, and after a light meal he was lying down and reading. Yet he called for his sandals, and climbed up to a spot from which he could command a good view of the curious phenomenon. Those who were looking at the cloud from some distance could not make out from which mountain it was rising - it was afterwards discovered to have been Mount Vesuvius - but in likeness and form it more closely resembled a pine-tree than anything else, for what corresponded to the trunk was of great length and height, and then spread out into a number of branches, the reason being, I imagine, that while the vapour was fresh, the cloud was borne upwards, but when the vapour became wasted, it lost its motion, or even became dissipated by its own weight, and spread out laterally. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1621, "div", 111);
    i0.\u0275\u0275text(1622, " [6] At times it looked white, and at other times dirty and spotted, according to the quantity of earth and cinders that were shot up. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1623, "div", 111);
    i0.\u0275\u0275text(1624, " [7] To a man of my uncle's learning, the phenomenon appeared one of great importance, which deserved a closer study. He ordered a Liburnian galley to be got ready, and offered to take me with him, if I desired to accompany him, but I replied that I preferred to go on with my studies, and it so happened that he had assigned me some writing to do. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1625, "div", 111);
    i0.\u0275\u0275text(1626, " [8] He was just leaving the house when he received a written message from Rectina, the wife of Tascus, who was terrified at the peril threatening her - for her villa lay just beneath the mountain, and there were no means of escape save by shipboard - begging him to save her from her perilous position. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1627, "div", 111);
    i0.\u0275\u0275text(1628, " [9] So he changed his plans, and carried out with the greatest fortitude the task, which he had started as a scholarly inquiry. He had the galleys launched and went on board himself, in the hope of succouring, not only Rectina, but many others, for there were a number of people living along the shore owing to its delightful situation. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1629, "div", 111);
    i0.\u0275\u0275text(1630, " [10] He hastened, therefore, towards the place whence others were fleeing, and steering a direct course, kept the helm straight for the point of danger, so utterly devoid of fear that every movement of the looming portent and every change in its appearance he described and had noted down by his secretary, as soon as his eyes detected it. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1631, "div", 111);
    i0.\u0275\u0275text(1632, ' [11] Already ashes were beginning to fall upon the ships, hotter and in thicker showers as they approached more nearly, with pumice-stones and black flints, charred and cracked by the heat of the flames, while their way was barred by the sudden shoaling of the sea bottom and the litter of the mountain on the shore. He hesitated for a moment whether to turn back, and then, when the helmsman warned him to do so, he exclaimed, "Fortune favours the bold; try to reach Pomponianus." ');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1633, "div", 111);
    i0.\u0275\u0275text(1634, " [12] The latter was at Stabiae, separated by the whole width of the bay, for the sea there pours in upon a gently rounded and curving shore. Although the danger was not yet close upon him, it was none the less clearly seen, and it travelled quickly as it came nearer, so Pomponianus had got his baggage together on shipboard, and had determined upon flight, and was waiting for the wind which was blowing on shore to fall. My uncle sailed in with the wind fair behind him, and embraced Pomponianus, who was in a state of fright, comforting and cheering him at the same time. Then in order to calm his friend's fears by showing how composed he was himself, he ordered the servants to carry him to the bath, and, after his ablutions, he sat down and had dinner in the best of spirits, or with that assumption of good spirits which is quite as remarkable as the reality. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1635, "div", 111);
    i0.\u0275\u0275text(1636, " [13] In the meantime broad sheets of flame, which rose high in the air, were breaking out in a number of places on Mount Vesuvius and lighting up the sky, and the glare and brightness seemed all the more striking owing to the darkness of the night. My uncle, in order to allay the fear of his companions, kept declaring that the country people in their terror had left their fires burning, and that the conflagration they saw arose from the blazing and empty villas. Then he betook himself to rest and enjoyed a very deep sleep, for his breathing, which, owing to his bulk, was rather heavy and loud, was heard by those who were waiting at the door of his chamber. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1637, "div", 111);
    i0.\u0275\u0275text(1638, " [14] But by this time the courtyard leading to the room he occupied was so full of ashes and pumice-stones mingled together, and covered to such a depth, that if he had delayed any longer in the bedchamber there would have been no means of escape. So my uncle was aroused, and came out and joined Pomponianus and the rest who had been keeping watch. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1639, "div", 111);
    i0.\u0275\u0275text(1640, " [15] They held a consultation whether they should remain indoors or wander forth in the open; for the buildings were beginning to shake with the repeated and intensely severe shocks of earthquake, and seemed to be rocking to and fro as though they had been torn from their foundations. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1641, "div", 111);
    i0.\u0275\u0275text(1642, " [16] Outside again there was danger to be apprehended from the pumice-stones, though these were light and nearly burnt through, and thus, after weighing the two perils, the latter course was determined upon. With my uncle it was a choice of reasons which prevailed, with the rest a choice of fears. They placed pillows on their heads and secured them with cloths, as a precaution against the falling bodies. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1643, "div", 111);
    i0.\u0275\u0275text(1644, " [17] Elsewhere the day had dawned by this time, but there it was still night, and the darkness was blacker and thicker than any ordinary night. This, however, they relieved as best they could by a number of torches and other kinds of lights. They decided to make their way to the shore, and to see from the nearest point whether the sea would enable them to put out, but it was still running high and contrary. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1645, "div", 111);
    i0.\u0275\u0275text(1646, " [18] A sheet was spread on the ground, and on this my uncle lay, and twice he called for a draught of cold water, which he drank. Then the flames, and the smell of sulphur which gave warning of them, scattered the others in flight and roused him. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1647, "div", 111);
    i0.\u0275\u0275text(1648, " [19] Leaning on two slaves, he rose to his feet and immediately fell down again, owing, as I think, to his breathing being obstructed by the thickness of the fumes and congestion of the stomach, that organ being naturally weak and narrow, and subject to inflammation. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1649, "div", 111);
