    i0.\u0275\u0275domElementStart(174, "div", 111);
    i0.\u0275\u0275text(175, " [1] Last year, Sir, when I was in serious ill-health and was in some danger of my life I called in an ointment-doctor, and I can only adequately repay him for the pains and interest he took in my case if you are kind enough to help me. ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(176, "div", 111);
    i0.\u0275\u0275text(177, " [2] Let me, therefore, entreat you to bestow on him the Roman citizenship, for he belongs to a foreign race and was manumitted by a foreign lady. His name is Harpocras, his patroness being Thermuthis, the daughter of Theon, but she has been dead for some years. I also beg you to give full Roman citizenship to the freedwomen of Antonia Maximilla, a lady of great distinction, Hedia, and Antonia Harmeris. It is at the request of their patroness that I beg this favour. ");
    i0.\u0275\u0275domElementEnd()()();
