    i0.\u0275\u0275text(22, " or two long syllables ");
    i0.\u0275\u0275domElementStart(23, "strong");
    i0.\u0275\u0275text(24, "(a spondee: \u2013 \u2013)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(25, ". The first four feet may either be dactyls or spondees. The fifth foot is normally (but not always) a dactyl. The sixth foot is an ");
    i0.\u0275\u0275domElementStart(26, "strong");
    i0.\u0275\u0275text(27, "anceps");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(28, ", i.e., either a long-long (\u2013 \u2013) or long-short (\u2013 \u02C7) ");
    i0.\u0275\u0275domElementStart(29, "strong");
    i0.\u0275\u0275text(30, "(a trochee)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(31, ". The last foot is usually always counted as a spondee though, by the ");
    i0.\u0275\u0275domElementStart(32, "strong");
    i0.\u0275\u0275text(33, "brevis in longo");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(34, " convention, where a seemingly short vowel is considered long for metrical purposes.");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(35, "p");
    i0.\u0275\u0275text(36, "A line of dactylic hexameter could follow a pattern like this:");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(37, "div", 1581)(38, "div", 1582);
    i0.\u0275\u0275text(39, "\u2013 \u02C7 \u02C7");
