    i0.\u0275\u0275domElementStart(48, "div", 1582);
    i0.\u0275\u0275text(49, "\u2013 \u2013");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(50, "h3");
    i0.\u0275\u0275text(51, "Quantity Determined by Nature:");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(52, "p");
    i0.\u0275\u0275text(53, 'Each foot of poetry thus consists of long and/or short syllables. If the syllable contains a short vowel or a long vowel, its quantity is said to be determined by its "nature" \u2014 it is short or long simply because it contains a short or long vowel. Thus:');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(54, "ol")(55, "li");
    i0.\u0275\u0275text(56, "A short syllable contains a short quantity vowel.");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(57, "li");
    i0.\u0275\u0275text(58, "A long syllable contains a long quantity vowel");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(59, "li");
    i0.\u0275\u0275text(60, "A long syllable may also contain a diphthong.");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(61, "p");
    i0.\u0275\u0275text(62, "Here are some general rules to assist in determining the nature of syllables:");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(63, "ul")(64, "li");
    i0.\u0275\u0275text(65, "A final ");
    i0.\u0275\u0275domElementStart(66, "strong");
    i0.\u0275\u0275text(67, "-o, -i,");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(68, " or ");
