    i0.\u0275\u0275domElement(72, "br");
    i0.\u0275\u0275domElementStart(73, "em");
    i0.\u0275\u0275text(74, "But: the final -i in tibi and mihi may be either short or long as the meter requires. (The first -i- in both words is always short.)");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(75, "li");
    i0.\u0275\u0275text(76, "A final ");
