    i0.\u0275\u0275text(78, "-as, -es,");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(79, " or ");
    i0.\u0275\u0275domElementStart(80, "strong");
    i0.\u0275\u0275text(81, "-os");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(82, " is usually long by nature.");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(83, "li");
    i0.\u0275\u0275text(84, "A final ");
    i0.\u0275\u0275domElementStart(85, "strong");
    i0.\u0275\u0275text(86, "-a");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(87, " or ");
    i0.\u0275\u0275domElementStart(88, "strong");
