    i0.\u0275\u0275domElementStart(92, "em");
    i0.\u0275\u0275text(93, "But: -a in the first declension ablative singular is always long, as is -is in the first and second declensions ablative / dative plural.");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(94, "li");
    i0.\u0275\u0275text(95, "A final ");
