    i0.\u0275\u0275text(97, "-e");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(98, " is usually short by nature.");
    i0.\u0275\u0275domElement(99, "br");
    i0.\u0275\u0275domElementStart(100, "em");
    i0.\u0275\u0275text(101, "But: -e in the fifth declension ablative singular and -e on adverbs formed from second declension adjectives are long by nature.");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(102, "li");
    i0.\u0275\u0275text(103, "A final ");
    i0.\u0275\u0275domElementStart(104, "strong");
    i0.\u0275\u0275text(105, "-us");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(106, " is usually short by nature.");
    i0.\u0275\u0275domElement(107, "br");
    i0.\u0275\u0275domElementStart(108, "em");
    i0.\u0275\u0275text(109, "But: fourth declension genitive singular, and nominative / accusative plural (but not fourth declension nominative singular) are long by nature.");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(110, "li");
    i0.\u0275\u0275text(111, "A final ");
    i0.\u0275\u0275domElementStart(112, "strong");
    i0.\u0275\u0275text(113, "-am, -em, ");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(114, "or ");
    i0.\u0275\u0275domElementStart(115, "strong");
    i0.\u0275\u0275text(116, "-um");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(117, " is always short by nature.");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(118, "li")(119, "strong");
    i0.\u0275\u0275text(120, "Diphthongs");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(121, " are two vowels combining to create one sound. The diphthongs in latin are ");
