    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(139, " in the phrase puella stat the -a of puella, although short by nature, is long because it is followed by two consonants. Similarly, the -e is also long by position.");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(140, "p");
    i0.\u0275\u0275text(141, "This rule is not absolute and some consonant combinations (-cr, -pr, and -tr) will not always create a preceding long vowel. ");
    i0.\u0275\u0275domElementStart(142, "strong");
    i0.\u0275\u0275text(143, "-l");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(144, " and ");
    i0.\u0275\u0275domElementStart(145, "strong");
    i0.\u0275\u0275text(146, "-r");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(147, " are what we call ");
    i0.\u0275\u0275domElementStart(148, "strong");
    i0.\u0275\u0275text(149, "liquid consonants");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(150, ", which means that, after following a consonant (-br and -cl), the preceding vowel isn't lengthened.");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(151, "p");
    i0.\u0275\u0275text(152, "The consonant ");
    i0.\u0275\u0275domElementStart(153, "strong");
    i0.\u0275\u0275text(154, "-h-");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(155, " is ");
    i0.\u0275\u0275domElementStart(156, "strong");
    i0.\u0275\u0275text(157, "not");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(158, " usually considered a full consonant, and will not normally lengthen a preceding vowel. For instance, in the phrase tenet haec, the syllable -et in tenet is short, not long.");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(159, "p");
    i0.\u0275\u0275text(160, "The consonants ");
    i0.\u0275\u0275domElementStart(161, "strong");
    i0.\u0275\u0275text(162, "-x-");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(163, " and ");
    i0.\u0275\u0275domElementStart(164, "strong");
    i0.\u0275\u0275text(165, "-z-");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(166, " will lengthen a preceding vowel, since they are actually ");
    i0.\u0275\u0275domElementStart(167, "strong");
    i0.\u0275\u0275text(168, "double consonants");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(169, " (-ks- and -ds-, respectively).");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(170, "p");
    i0.\u0275\u0275text(171, "The common combination ");
    i0.\u0275\u0275domElementStart(172, "strong");
    i0.\u0275\u0275text(173, "-qu-");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(174, " will never lengthen a preceding vowel. Also, the -u is never long.");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(175, "p");
    i0.\u0275\u0275text(176, "Remember that ");
    i0.\u0275\u0275domElementStart(177, "strong");
    i0.\u0275\u0275text(178, "-i-");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(179, " in Latin is sometimes a consonant, like in the word Troiam. Think: is the i acting as a j in this word? If it is, it is acting as a consonant.");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(180, "h3");
    i0.\u0275\u0275text(181, "Elision and Hiatus:");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(182, "p");
    i0.\u0275\u0275text(183, "Elision is the omission of certain syllables in scansion. It has two basic rules:");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(184, "ol")(185, "li");
    i0.\u0275\u0275text(186, "A final syllable ending in a vowel may be omitted before a word beginning with a ");
    i0.\u0275\u0275domElementStart(187, "strong");
    i0.\u0275\u0275text(188, "vowel");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(189, " or an ");
    i0.\u0275\u0275domElementStart(190, "strong");
    i0.\u0275\u0275text(191, "h-");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(192, ".");
    i0.\u0275\u0275domElement(193, "br");
    i0.\u0275\u0275domElementStart(194, "em");
    i0.\u0275\u0275text(195, 'Thus in nauta est the final -a is elided or "knocked out," leaving two syllables: naut est.');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElement(196, "br");
    i0.\u0275\u0275domElementStart(197, "strong");
    i0.\u0275\u0275text(198, "Nota Bene:");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(199, " The syllable may or may not be omitted. The term for deliberate avoidance of elision is called hiatus.");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(200, "li");
    i0.\u0275\u0275text(201, "A final syllable ending in the letter ");
    i0.\u0275\u0275domElementStart(202, "strong");
    i0.\u0275\u0275text(203, "-m");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(204, " may be omitted from the meter before a word beginning with a ");
    i0.\u0275\u0275domElementStart(205, "strong");
    i0.\u0275\u0275text(206, "vowel");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(207, " or an ");
    i0.\u0275\u0275domElementStart(208, "strong");
    i0.\u0275\u0275text(209, "h-");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(210, ".");
    i0.\u0275\u0275domElement(211, "br");
    i0.\u0275\u0275domElementStart(212, "em");
    i0.\u0275\u0275text(213, "Thus, nautam esse becomes naut esse. Instead of saying this phrase has 4 total syllables, with the elision, it has only 3.");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElement(214, "br");
    i0.\u0275\u0275domElementStart(215, "em");
    i0.\u0275\u0275text(216, "Multum ille becomes mulltille.");
    i0.\u0275\u0275domElementEnd()()();
    i0.\u0275\u0275domElementStart(217, "p", 1583);
    i0.\u0275\u0275text(218, "Adapted from ");
