    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(942, "p");
    i0.\u0275\u0275text(943, "A narrative or description that conveys a hidden meaning, often moral or political.");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(944, "div", 1650)(945, "h4");
    i0.\u0275\u0275text(946, "2. Alliteration");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(947, "p");
    i0.\u0275\u0275text(948, "The repetition of initial consonant sounds in a series of words");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(949, "div", 1648);
    i0.\u0275\u0275text(950, '"Peter Piper picked a peck of pickled peppers"');
