    i0.\u0275\u0275domElementStart(951, "div", 1650)(952, "h4");
    i0.\u0275\u0275text(953, "3. Anaphora");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(954, "p");
    i0.\u0275\u0275text(955, "The repetition of a word/phrase at the beginning of successive clauses or sentences.");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(956, "div", 1650)(957, "h4");
    i0.\u0275\u0275text(958, "4. Anastrophe");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(959, "p");
