    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(961, "div", 1650)(962, "h4");
    i0.\u0275\u0275text(963, "5. Aposiopesis");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(964, "p");
    i0.\u0275\u0275text(965, "A sudden breaking off in speech, leaving a thought unfinished");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(966, "div", 1648);
    i0.\u0275\u0275text(967, `"If you say that again, I'll\u2014"`);
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(968, "div", 1650)(969, "h4");
    i0.\u0275\u0275text(970, "6. Apostrophe");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(971, "p");
    i0.\u0275\u0275text(972, "A direct address to an absent person, object, or abstract idea");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(973, "div", 1648);
    i0.\u0275\u0275text(974, '"O Death, where is thy sting?"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(975, "div", 1650)(976, "h4");
    i0.\u0275\u0275text(977, "7. Asyndeton");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(978, "p");
    i0.\u0275\u0275text(979, "The omission of conjunctions between clauses for effect");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(980, "div", 1648);
    i0.\u0275\u0275text(981, '"I came, I saw, I conquered"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(982, "div", 1650)(983, "h4");
    i0.\u0275\u0275text(984, "8. Chiasmus");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(985, "p");
    i0.\u0275\u0275text(986, "A rhetorical device in which two clauses are structured in a reverse order");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(987, "div", 1648);
    i0.\u0275\u0275text(988, '"Ask not what your country can do for you\u2014ask what you can do for your country"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(989, "div", 1650)(990, "h4");
    i0.\u0275\u0275text(991, "9. Ekphrasis");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(992, "p");
    i0.\u0275\u0275text(993, "A vivid, detailed description of a work of art or a visual scene.");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(994, "div", 1650)(995, "h4");
    i0.\u0275\u0275text(996, "10. Ellipsis");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(997, "p");
    i0.\u0275\u0275text(998, "The omission of words that are understood in context");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(999, "div", 1648);
    i0.\u0275\u0275text(1e3, '"Some people prefer cats; others, dogs"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1001, "div", 1650)(1002, "h4");
    i0.\u0275\u0275text(1003, "11. Enjambment");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1004, "p");
    i0.\u0275\u0275text(1005, "In poetry, the continuation of a sentence beyond the end of a line without a pause.");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1006, "div", 1650)(1007, "h4");
    i0.\u0275\u0275text(1008, "12. Hendiadys");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1009, "p");
    i0.\u0275\u0275text(1010, 'The expression of a single idea using two nouns connected by "and" instead of an adjective-noun structure');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1011, "div", 1648);
    i0.\u0275\u0275text(1012, '"Sound and fury" instead of "furious sound"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1013, "div", 1650)(1014, "h4");
    i0.\u0275\u0275text(1015, "13. Hyperbaton");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1016, "p");
    i0.\u0275\u0275text(1017, "The inversion of normal word order for emphasis");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1018, "div", 1648);
    i0.\u0275\u0275text(1019, '"This I must see"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1020, "div", 1650)(1021, "h4");
    i0.\u0275\u0275text(1022, "14. Hyperbole");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1023, "p");
    i0.\u0275\u0275text(1024, "Exaggeration for effect");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1025, "div", 1648);
    i0.\u0275\u0275text(1026, `"I'm so hungry I could eat a horse"`);
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1027, "div", 1650)(1028, "h4");
    i0.\u0275\u0275text(1029, "15. Hysteron proteron");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1030, "p");
    i0.\u0275\u0275text(1031, "A reversal of the natural order of events");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1032, "div", 1648);
    i0.\u0275\u0275text(1033, '"Put on your shoes and socks"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1034, "div", 1650)(1035, "h4");
    i0.\u0275\u0275text(1036, "16. Litotes");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1037, "p");
    i0.\u0275\u0275text(1038, "Understatement using double negatives or negating the opposite");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1039, "div", 1648);
    i0.\u0275\u0275text(1040, '"Not bad" meaning "good"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1041, "div", 1650)(1042, "h4");
    i0.\u0275\u0275text(1043, "17. Metaphor");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1044, "p");
    i0.\u0275\u0275text(1045, 'A direct comparison between two unlike things without using "like" or "as"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1046, "div", 1648);
    i0.\u0275\u0275text(1047, '"Time is a thief"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1048, "div", 1650)(1049, "h4");
    i0.\u0275\u0275text(1050, "18. Metonymy");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1051, "p");
    i0.\u0275\u0275text(1052, "Substituting the name of one thing with something closely related");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1053, "div", 1648);
    i0.\u0275\u0275text(1054, '"The White House issued a statement" instead of "The President issued a statement"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1055, "div", 1650)(1056, "h4");
    i0.\u0275\u0275text(1057, "19. Onomatopoeia");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1058, "p");
    i0.\u0275\u0275text(1059, "A word that imitates a sound");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1060, "div", 1648);
    i0.\u0275\u0275text(1061, '"Buzz," "sizzle"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1062, "div", 1650)(1063, "h4");
    i0.\u0275\u0275text(1064, "20. Personification");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1065, "p");
    i0.\u0275\u0275text(1066, "Giving human qualities to non-human things");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1067, "div", 1648);
    i0.\u0275\u0275text(1068, '"The wind whispered through the trees"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1069, "div", 1650)(1070, "h4");
    i0.\u0275\u0275text(1071, "21. Pleonasm");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1072, "p");
    i0.\u0275\u0275text(1073, "The use of redundant words for emphasis");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1074, "div", 1648);
    i0.\u0275\u0275text(1075, '"Burning fire" or "free gift"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1076, "div", 1650)(1077, "h4");
    i0.\u0275\u0275text(1078, "22. Polyptoton");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1079, "p");
    i0.\u0275\u0275text(1080, "Repetition of the same root word in different forms");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1081, "div", 1648);
    i0.\u0275\u0275text(1082, '"strong" and "strength"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1083, "div", 1650)(1084, "h4");
    i0.\u0275\u0275text(1085, "23. Polysyndeton");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1086, "p");
    i0.\u0275\u0275text(1087, "The use of multiple conjunctions for emphasis");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1088, "div", 1648);
    i0.\u0275\u0275text(1089, '"We have ships and men and money and supplies"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1090, "div", 1650)(1091, "h4");
    i0.\u0275\u0275text(1092, "24. Praeteritio");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1093, "p");
    i0.\u0275\u0275text(1094, "Calling attention to something by claiming to omit it");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1095, "div", 1648);
    i0.\u0275\u0275text(1096, `"I won't even mention his bad habits"`);
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1097, "div", 1650)(1098, "h4");
    i0.\u0275\u0275text(1099, "25. Prolepsis");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1100, "p");
    i0.\u0275\u0275text(1101, "Anticipating and answering objections in advance, or using a future event as if it has already occurred.");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1102, "div", 1650)(1103, "h4");
    i0.\u0275\u0275text(1104, "26. Prosopopoeia");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1105, "p");
    i0.\u0275\u0275text(1106, "A type of personification where an inanimate object or absent person is given speech.");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1107, "div", 1650)(1108, "h4");
    i0.\u0275\u0275text(1109, "27. Rhetorical question");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1110, "p");
    i0.\u0275\u0275text(1111, "A question asked for effect, not expecting an answer");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1112, "div", 1648);
    i0.\u0275\u0275text(1113, `"Isn't it obvious"`);
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1114, "div", 1650)(1115, "h4");
    i0.\u0275\u0275text(1116, "28. Simile");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1117, "p");
    i0.\u0275\u0275text(1118, 'A comparison using "like" or "as"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1119, "div", 1648);
    i0.\u0275\u0275text(1120, '"Brave as a lion"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1121, "div", 1650)(1122, "h4");
    i0.\u0275\u0275text(1123, "29. Synchesis/Golden Line");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1124, "p");
    i0.\u0275\u0275text(1125, "A confused or interwoven word order (synchesis with a verb in the middle)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1126, "div", 1648);
    i0.\u0275\u0275text(1127, '"Golden happy ring girl" instead of "happy golden-haired girl"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1128, "div", 1650)(1129, "h4");
    i0.\u0275\u0275text(1130, "30. Synecdoche");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1131, "p");
    i0.\u0275\u0275text(1132, "Using a part to represent the whole");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1133, "div", 1648);
    i0.\u0275\u0275text(1134, '"All hands on deck" meaning sailors, not just their hands');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1135, "div", 1650)(1136, "h4");
    i0.\u0275\u0275text(1137, "31. Tmesis");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1138, "p");
    i0.\u0275\u0275text(1139, "The separation of a compound word into two parts, often for emphasis");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1140, "div", 1648);
    i0.\u0275\u0275text(1141, '"Abso-bloody-lutely"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1142, "div", 1648);
    i0.\u0275\u0275text(1143, '"Quo quemque modo" = "quomodo quemque" aeneid VI.891');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1144, "div", 1650)(1145, "h4");
    i0.\u0275\u0275text(1146, "32. Transferred epithet");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1147, "p");
    i0.\u0275\u0275text(1148, "An adjective that grammatically modifies one noun but logically describes another");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1149, "div", 1648);
    i0.\u0275\u0275text(1150, `"Restless night" when it's the person who is restless, not the night`);
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1151, "div", 1650)(1152, "h4");
    i0.\u0275\u0275text(1153, "33. Tricolon crescens");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1154, "p");
    i0.\u0275\u0275text(1155, "A series of three elements in increasing intensity or size");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1156, "div", 1648);
    i0.\u0275\u0275text(1157, '"I came, I saw, I conquered"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1158, "div", 1650)(1159, "h4");
    i0.\u0275\u0275text(1160, "34. Zeugma");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1161, "p");
    i0.\u0275\u0275text(1162, "A single word (often a verb) governing two or more words in different senses");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1163, "div", 1648);
    i0.\u0275\u0275text(1164, '"He stole my heart and my wallet"');
    i0.\u0275\u0275domElementEnd()()()();
    i0.\u0275\u0275domElementStart(1165, "div", 1627)(1166, "h2");
    i0.\u0275\u0275text(1167, "Derivatives of Cases");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1168, "div", 1651)(1169, "h3");
    i0.\u0275\u0275text(1170, "Genitive");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1171, "div", 1652)(1172, "h4");
    i0.\u0275\u0275text(1173, "Partitive genitive");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1174, "p");
    i0.\u0275\u0275text(1175, "Used for the larger whole of which something is a part");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1176, "div", 1648);
    i0.\u0275\u0275text(1177, '"pars civitatis \u2192 part of the state"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1178, "div", 1653);
    i0.\u0275\u0275text(1179, "All of the state is not partitive (it's not part of a whole), therefore in Latin, you just use an adj: omnis civitas");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1180, "div", 1652)(1181, "h4");
    i0.\u0275\u0275text(1182, "Genitive of description");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1183, "p");
    i0.\u0275\u0275text(1184, "Usually composed of a noun + adj");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1185, "div", 1648);
    i0.\u0275\u0275text(1186, '"vir magnae sapientiae \u2192 a man of great wisdom \u2192 a very wise man"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1187, "div", 1652)(1188, "h4");
    i0.\u0275\u0275text(1189, "Subjective/objective genitive");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1190, "p");
    i0.\u0275\u0275text(1191, "When two things are in genitive (usually the first one is the object and the subject one is in adj form)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1192, "div", 1648);
    i0.\u0275\u0275text(1193, '"severitatis invidiae \u2192 hatred of severity"');
    i0.\u0275\u0275domElementEnd()()();
    i0.\u0275\u0275domElementStart(1194, "div", 1651)(1195, "h3");
    i0.\u0275\u0275text(1196, "Dative");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1197, "div", 1652)(1198, "h4");
    i0.\u0275\u0275text(1199, "Dative of Agent");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1200, "p");
    i0.\u0275\u0275text(1201, "Used w gerundive to indicate upon whom the obligation lies");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1202, "div", 1648);
    i0.\u0275\u0275text(1203, '"haec tibi agenda sunt \u2192 these things are to be done by you" or "these things are for you to do"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1204, "div", 1652)(1205, "h4");
    i0.\u0275\u0275text(1206, "Dative of Possession");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1207, "p");
    i0.\u0275\u0275text(1208, "Used with esse (sometimes the esse is implied)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1209, "div", 1648);
    i0.\u0275\u0275text(1210, '"Tantaene animis caelestibus irae"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1211, "div", 1648);
    i0.\u0275\u0275text(1212, '"est mihi domi pater \u2192 I have a father at home (there is a father to me at home)"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1213, "div", 1652)(1214, "h4");
    i0.\u0275\u0275text(1215, "Dative of Reference");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1216, "p");
    i0.\u0275\u0275text(1217, "Usual dative");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1218, "div", 1652)(1219, "h4");
    i0.\u0275\u0275text(1220, "Dative of purpose");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1221, "div", 1648);
    i0.\u0275\u0275text(1222, '"locum castris deligit \u2192 he selects a location for the camp"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1223, "div", 1648);
    i0.\u0275\u0275text(1224, '"rei publicae cladi sunt \u2192 They are ruin to the state (they are for a disaster to the state)"');
    i0.\u0275\u0275domElementEnd()()();
    i0.\u0275\u0275domElementStart(1225, "div", 1651)(1226, "h3");
    i0.\u0275\u0275text(1227, "Accusative");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1228, "div", 1652)(1229, "h4");
    i0.\u0275\u0275text(1230, "Accusative of place to which");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1231, "div", 1648);
    i0.\u0275\u0275text(1232, '"Veronam venis? \u2192 are you coming to Verona?"');
