    i0.\u0275\u0275domElementStart(1233, "div", 1652)(1234, "h4");
    i0.\u0275\u0275text(1235, "Accusative of time duration");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1236, "div", 1648);
    i0.\u0275\u0275text(1237, '"multos annos regnavit \u2192 he ruled for many years"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1238, "div", 1648);
    i0.\u0275\u0275text(1239, '"decem dies manebit \u2192 he will stay for ten days"');
    i0.\u0275\u0275domElementEnd()()();
    i0.\u0275\u0275domElementStart(1240, "div", 1651)(1241, "h3");
    i0.\u0275\u0275text(1242, "Ablative");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1243, "div", 1652)(1244, "h4");
    i0.\u0275\u0275text(1245, "Ablative of cause");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1246, "p");
    i0.\u0275\u0275text(1247, "Usually without prep (or ex or de)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1248, "div", 1648);
    i0.\u0275\u0275text(1249, '"ex ira clamavit \u2192 he shouted out of anger"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1250, "div", 1648);
