    i0.\u0275\u0275domElementStart(1252, "div", 1652)(1253, "h4");
    i0.\u0275\u0275text(1254, "Ablative of agent");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1255, "p");
    i0.\u0275\u0275text(1256, "By whom (passive verb, a/ab, ablative) (means has no a/ab and is usually a tool)");
