    i0.\u0275\u0275domElementStart(1257, "div", 1652)(1258, "h4");
    i0.\u0275\u0275text(1259, "Ablative of time when");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1260, "p");
    i0.\u0275\u0275text(1261, "No prep, ordinal numbers");
