    i0.\u0275\u0275domElementStart(1267, "p");
    i0.\u0275\u0275text(1268, "No prep, usually cardinal numbers");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1269, "div", 1648);
    i0.\u0275\u0275text(1270, '"paucis horis discedent \u2192 they will depart within a few hours"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1271, "div", 1652)(1272, "h4");
    i0.\u0275\u0275text(1273, "Ablative of comparison");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1274, "p");
    i0.\u0275\u0275text(1275, "No quam; but when using quam, both nouns have the same case");
