    i0.\u0275\u0275domElementStart(1276, "div", 1648);
    i0.\u0275\u0275text(1277, '"marcus est altior Paulo \u2192 Marcus is taller than Paul"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1278, "div", 1648);
    i0.\u0275\u0275text(1279, '"Marcus est altior quam Paulus"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1280, "div", 1652)(1281, "h4");
    i0.\u0275\u0275text(1282, "Ablative of separation");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1283, "p");
    i0.\u0275\u0275text(1284, "Can be w or wout prep; more abstract, talking about freeing or lacking: physical or abstract act of separation");
