    i0.\u0275\u0275domElementStart(1290, "div", 1652)(1291, "h4");
    i0.\u0275\u0275text(1292, "Ablative of respect");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1293, "p");
    i0.\u0275\u0275text(1294, "(Distinguished in piety)");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1295, "div", 1652)(1296, "h4");
    i0.\u0275\u0275text(1297, "Ablative of place where");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1298, "p");
    i0.\u0275\u0275text(1299, "Preposition + non-motion verb");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1300, "div", 1648);
    i0.\u0275\u0275text(1301, '"maneo in Africa \u2192 I am staying in Africa"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1302, "div", 1652)(1303, "h4");
    i0.\u0275\u0275text(1304, "Ablative of means");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1305, "p");
    i0.\u0275\u0275text(1306, "Accompanies a verb");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1307, "div", 1648);
    i0.\u0275\u0275text(1308, '"pedibus \u2192 on foot"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1309, "div", 1648);
    i0.\u0275\u0275text(1310, '"equis \u2192 by horse"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1311, "div", 1652)(1312, "h4");
    i0.\u0275\u0275text(1313, "Ablative of instrument");
