    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1318, "div", 1652)(1319, "h4");
    i0.\u0275\u0275text(1320, "Ablative of manner");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1321, "p");
