    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1323, "div", 1648);
    i0.\u0275\u0275text(1324, '"Magna voce \u2192 in a loud voice"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1325, "div", 1652)(1326, "h4");
    i0.\u0275\u0275text(1327, "Ablative of quality");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1328, "p");
    i0.\u0275\u0275text(1329, "Describes the noun");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1330, "div", 1648);
