    i0.\u0275\u0275text(1336, 'Form looks genitive or ablative, answers "where?"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1337, "p");
    i0.\u0275\u0275text(1338, "Usually the same as the gen sg; for plural nouns (1 and 2) same form as abl pl; special forms: domus\u2192domi; rus\u2192ruri.");
    i0.\u0275\u0275domElementEnd()()();
    i0.\u0275\u0275domElementStart(1339, "div", 1627)(1340, "h2");
    i0.\u0275\u0275text(1341, "Advanced Grammar Concepts");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1342, "div", 1654)(1343, "h3");
    i0.\u0275\u0275text(1344, "Conditionals");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1345, "div", 1655)(1346, "h4");
    i0.\u0275\u0275text(1347, "Subjunctive");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1348, "div", 1656)(1349, "h5");
    i0.\u0275\u0275text(1350, "Past Contrary to Fact");
