    i0.\u0275\u0275text(1352, "Pluperfect subjunctive (translate with had and would have)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1353, "div", 1648);
    i0.\u0275\u0275text(1354, '"Si id fecisset, prudens fuisset" \u2192 "if he had done this, he would have been wise"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1355, "div", 1656)(1356, "h5");
    i0.\u0275\u0275text(1357, "Present Contrary to Fact");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1358, "p");
    i0.\u0275\u0275text(1359, "Imperfect subjunctive (translate with were and would (be))");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1360, "div", 1648);
    i0.\u0275\u0275text(1361, '"si id facerent, prudens esset" \u2192 "if he were doing this, he would be wise"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1362, "div", 1656)(1363, "h5");
    i0.\u0275\u0275text(1364, "Future Less Vivid (should would)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1365, "p");
    i0.\u0275\u0275text(1366, "Present subjunctive (translate with should and would)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1367, "div", 1648);
    i0.\u0275\u0275text(1368, '"si id faciat, prudens sit" \u2192 "if he should do this, he would be wise"');
    i0.\u0275\u0275domElementEnd()()();
    i0.\u0275\u0275domElementStart(1369, "div", 1655)(1370, "h4");
    i0.\u0275\u0275text(1371, "Indicative");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1372, "div", 1656)(1373, "h5");
    i0.\u0275\u0275text(1374, "Simple Fact Past");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1375, "p");
    i0.\u0275\u0275text(1376, "Past (either imperfect or perfect) indicative");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1377, "div", 1648);
    i0.\u0275\u0275text(1378, '"si id fecit, prudens fuit" \u2192 "If he did this, he was wise"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1379, "div", 1656)(1380, "h5");
    i0.\u0275\u0275text(1381, "Simple Fact Present");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1382, "p");
    i0.\u0275\u0275text(1383, "Present indicative");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1384, "div", 1648);
    i0.\u0275\u0275text(1385, '"si id facit, prudens est" \u2192 "if he is doing this, he is wise"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1386, "div", 1656)(1387, "h5");
    i0.\u0275\u0275text(1388, "Future More Vivid");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1389, "p");
    i0.\u0275\u0275text(1390, "Future indicative (can also be future perfect)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1391, "div", 1648);
    i0.\u0275\u0275text(1392, '"si id faciet, prudens erit" \u2192 "if he does (will do) this, he will be wise"');
    i0.\u0275\u0275domElementEnd()()()();
    i0.\u0275\u0275domElementStart(1393, "div", 1654)(1394, "h3");
    i0.\u0275\u0275text(1395, "Key Latin Language Conventions");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1396, "div", 1657)(1397, "h4");
    i0.\u0275\u0275text(1398, "Indirect Statement");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1399, "p");
    i0.\u0275\u0275text(1400, "With head verbs (saying thinking, knowing, perceiving, feeling, seeing hearing, etc.) and infinitives (tense is relative) (accusative subject)");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1401, "div", 1657)(1402, "h4");
    i0.\u0275\u0275text(1403, "Ablative Absolute");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1404, "p");
    i0.\u0275\u0275text(1405, "Noun/pronoun with modifying ablative participle (self-contained, independent from main clause)");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1406, "div", 1657)(1407, "h4");
    i0.\u0275\u0275text(1408, "Gerund");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1409, "p");
    i0.\u0275\u0275text(1410, "Verbal noun (only 4th principal part neuter singular (gen, dat, acc, abl))");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1411, "div", 1648);
    i0.\u0275\u0275text(1412, 'Amor legendi "love of reading"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1413, "div", 1657)(1414, "h4");
    i0.\u0275\u0275text(1415, "Gerundive");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1416, "p");
    i0.\u0275\u0275text(1417, "Verbal adjective 4th principal part (-ndus, -nda, -ndum) (denotes necessity or obligation)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1418, "div", 1648);
    i0.\u0275\u0275text(1419, 'Liber legendus "a book (about) to be read"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1420, "p");
    i0.\u0275\u0275text(1421, "After a verb like give, deliver, have, receive, demand, undertake, the gerundive describes a purpose:");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1422, "div", 1648);
    i0.\u0275\u0275text(1423, 'Aedem Castoris habuit tuendam "he had the temple of Castor to take care of"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1424, "div", 1657)(1425, "h4");
    i0.\u0275\u0275text(1426, "Gerund-Gerundive Flip");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1427, "p");
    i0.\u0275\u0275text(1428, "Latin prefers not to use gerunds for direct objects. The gerund-gerundive flip can happen in any case where the gerund would have taken a direct object. Latin prefers to flip to a gerundive phrase that agrees with the object.");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1429, "div", 1648);
    i0.\u0275\u0275text(1430, "Acc with ad (purpose): ad vicendum hostes (for conquering the enemies) \u2192 ad hostes vicendos (for the enemies to be conquered)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1431, "div", 1648);
    i0.\u0275\u0275text(1432, "Gen expressing purpose, cause, or description: ars scribendi libros (the art of writing books) \u2192 ars librorum scribendorum (the art of books to be written)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1433, "div", 1648);
    i0.\u0275\u0275text(1434, "Dat (purpose): studium legendi libros (enthusiasm for reading books) \u2192 studium libris legendis (enthusiasm for books to be read)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1435, "div", 1648);
    i0.\u0275\u0275text(1436, "Abl (means, cause, manner): in discendo linguas (in learning languages) \u2192 in discendis linguis (in languages to be learned)");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1437, "div", 1657)(1438, "h4");
    i0.\u0275\u0275text(1439, "Supine");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1440, "p");
    i0.\u0275\u0275text(1441, "4th principal part stem (-um (acc)/ -u (abl)):");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1442, "p");
    i0.\u0275\u0275text(1443, "Accusative: verbs of motion indicating purpose (to _)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1444, "div", 1648);
    i0.\u0275\u0275text(1445, '"persuasum amicis venerunt \u2192 they came to persuade the friends"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1446, "p");
    i0.\u0275\u0275text(1447, "Ablative: used with neuter of adjectives (to _)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1448, "div", 1648);
    i0.\u0275\u0275text(1449, '"mirabile dictu \u2192 amazing to say"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1450, "div", 1657)(1451, "h4");
    i0.\u0275\u0275text(1452, "Hortatory");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1453, "p");
    i0.\u0275\u0275text(1454, "Independent subjunctive, same as jussive in construction, but only 1st plural");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1455, "div", 1657)(1456, "h4");
    i0.\u0275\u0275text(1457, "Jussive");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1458, "p");
    i0.\u0275\u0275text(1459, "Independent subjunctive (main verb is subjunctive)");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1460, "div", 1657)(1461, "h4");
    i0.\u0275\u0275text(1462, "Deliberative Question");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1463, "p");
    i0.\u0275\u0275text(1464, "Independent subjunctive: subjunctive (can also be indicative) question, expressing doubt, indignation, or impossibility, as if asking the speaker's own advice. (translation: interrogative+auxiliary+inf (can use shall/should, can/could))");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1465, "div", 1648);
    i0.\u0275\u0275text(1466, '"quid agam \u2192 what am i to do?"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1467, "div", 1657)(1468, "h4");
    i0.\u0275\u0275text(1469, "Potential Subjunctive");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1470, "p");
    i0.\u0275\u0275text(1471, "Independent subjunctive: suggests an action as conceivable/possible subjunctive. In an independent clause (pres/ft: refer to the future; impf: to the past; plup (rare): what might have happened; should, would, may, might + tense indicator");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1472, "div", 1648);
    i0.\u0275\u0275text(1473, '"velim sic existimes \u2192 I should wish you to think thus"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1474, "div", 1657)(1475, "h4");
    i0.\u0275\u0275text(1476, "Indirect Command");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1477, "p");
    i0.\u0275\u0275text(1478, "Dependent subjunctive: subjunctive clause introduced by ut/ne with command-ish verbs (translate verb in the clause as an infinitive)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1479, "div", 1648);
    i0.\u0275\u0275text(1480, '"imperat vobis ut hoc faciatis \u2192 he commands you (pl) to do this"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1481, "div", 1657)(1482, "h4");
    i0.\u0275\u0275text(1483, "Indirect Question");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1484, "p");
    i0.\u0275\u0275text(1485, "Dependent subjunctive: indicative discourse verbs, subjunctive clause with interrogative word (IC, interrogative, DC)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1486, "div", 1648);
    i0.\u0275\u0275text(1487, '"rogant quid Gaius faciat \u2192 They ask what Gaius is doing"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1488, "div", 1657)(1489, "h4");
    i0.\u0275\u0275text(1490, "Purpose");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1491, "p");
    i0.\u0275\u0275text(1492, "Dependent subjunctive: subjunctive clause introduced by ut/ne (in order to infinitive or use may/might)");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1493, "div", 1657)(1494, "h4");
    i0.\u0275\u0275text(1495, "Result");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1496, "p");
    i0.\u0275\u0275text(1497, "Dependent subjunctive: ut (not ne), adverb (ita sic tam adeo), adjective (tantus); translated with no auxiliaries");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1498, "div", 1657)(1499, "h4");
    i0.\u0275\u0275text(1500, "Cum Clauses");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1501, "p");
    i0.\u0275\u0275text(1502, "Cum temporal clause: indicative (when..) can also be circumstantial");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1503, "p");
    i0.\u0275\u0275text(1504, "Causal clause: subjunctive + causal relationship (since\u2026)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1505, "p");
    i0.\u0275\u0275text(1506, "Concessive clause: subjunctive + tamen (although\u2026nevertheless)");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1507, "div", 1657)(1508, "h4");
    i0.\u0275\u0275text(1509, "Proviso Clause");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1510, "p");
    i0.\u0275\u0275text(1511, "dummodo (+ne): (provided that\u2026)");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1512, "div", 1657)(1513, "h4");
    i0.\u0275\u0275text(1514, "Fear Clause");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1515, "p");
    i0.\u0275\u0275text(1516, "vereor, metuo, and timeo (ut and ne are inverted): will/may (present); would/might (imperfect)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1517, "div", 1648);
    i0.\u0275\u0275text(1518, '"timeo ne id credant \u2192 I fear that they will believe this"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1519, "div", 1648);
    i0.\u0275\u0275text(1520, '"vereor ut id credant \u2192 I fear that they may not believe this"');
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1521, "div", 1657)(1522, "h4");
    i0.\u0275\u0275text(1523, "Relative Clause of Description");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1524, "p");
    i0.\u0275\u0275text(1525, "Agrees with antecedent in gender and number with no forms that indicate otherwise");
    i0.\u0275\u0275domElementEnd()();
    i0.\u0275\u0275domElementStart(1526, "div", 1657)(1527, "h4");
    i0.\u0275\u0275text(1528, "Relative Clause of Characteristic");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1529, "p");
    i0.\u0275\u0275text(1530, "Relative pronoun, subjunctive verb in clause, general, indefinite, interrogative, negative antecedent (nemo, quis, etc.)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1531, "p");
    i0.\u0275\u0275text(1532, '"The sort of/ the kind of" to indicate an indefinite antecedent');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1533, "p");
    i0.\u0275\u0275text(1534, '"would" for the subjunctive verb');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1535, "div", 1648);
    i0.\u0275\u0275text(1536, '"Hic est liber quem omnes legant \u2192 This is the kind of book that all would read"');
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1537, "div", 1648);
    i0.\u0275\u0275text(1538, '"Quis est qui huic credat \u2192 Who is there who (is of such a kind that he) would trust this man?"');
    i0.\u0275\u0275domElementEnd()()();
    i0.\u0275\u0275domElementStart(1539, "div", 1654)(1540, "h3");
    i0.\u0275\u0275text(1541, "Extra Helpful Things");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1542, "div", 1658)(1543, "div", 1659);
    i0.\u0275\u0275text(1544, "Si quis = anyone");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1545, "div", 1659);
    i0.\u0275\u0275text(1546, "Quodque = each");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1547, "div", 1659);
    i0.\u0275\u0275text(1548, "Ne quis = no one");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1549, "div", 1659);
    i0.\u0275\u0275text(1550, "Si nisi num ne, all the alis go away");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1551, "div", 1659);
    i0.\u0275\u0275text(1552, "Passive periphrastic demands a dative of agent (by _dat_)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1553, "div", 1659);
    i0.\u0275\u0275text(1554, "Dum + subjunctive = until");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1555, "div", 1659);
    i0.\u0275\u0275text(1556, "Latin diphthongs: ae, oe, eu, ei, au, ui");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1557, "div", 1659);
    i0.\u0275\u0275text(1558, "Ne-for a neutral question");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1559, "div", 1659);
    i0.\u0275\u0275text(1560, "num -expects no for an answer");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1561, "div", 1659);
    i0.\u0275\u0275text(1562, "Quisquam is any or anyone");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1563, "div", 1659);
    i0.\u0275\u0275text(1564, "Nonne-expects yes for an answer");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1565, "div", 1659);
    i0.\u0275\u0275text(1566, "Qua any way or any");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1567, "div", 1659);
    i0.\u0275\u0275text(1568, "Quisque, quaeque, quodque: each every");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1569, "div", 1659);
    i0.\u0275\u0275text(1570, "Quoad: until");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1571, "div", 1659);
    i0.\u0275\u0275text(1572, "Ipse is intensive (he himself did this)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1573, "div", 1659);
    i0.\u0275\u0275text(1574, "Se is reflexive (he hurt himself)");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1575, "div", 1659);
    i0.\u0275\u0275text(1576, "3 i-stem neuter \u2013 nominative singular will end in al/ar/e");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1577, "div", 1659);
    i0.\u0275\u0275text(1578, "3rd conjugation stem change");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1579, "div", 1659);
    i0.\u0275\u0275text(1580, "quam + superlative: as ___ as possible");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275domElementStart(1581, "div", 1659)(1582, "strong");
    i0.\u0275\u0275text(1583, "Demonstratives:");
    i0.\u0275\u0275domElementEnd();
    i0.\u0275\u0275text(1584, " hic, ille, iste, is, ea, id");
    i0.\u0275\u0275domElementEnd()()();
    i0.\u0275\u0275domElementStart(1585, "div", 1654)(1586, "h3");
